import React, { Component } from "react";
import "../css/ToDoList.css";

const ToDoList = () => {
  return (
    <div className="to-do-list-container">
      <input />
      <button>submit</button>
      <div className="list-item">
        <text>item 1</text>
        <button>remove</button>
      </div>
    </div>
  );
};

export default ToDoList;
